import React from 'react';

// Import the BrowserRouter, Route and Link components
import { BrowserRouter, Route, Link } from 'react-router-dom'; 
import Home from './Home.js';
import Projects from './Projects.js'; 
import Articles from './Articles.js'; 
import About from './About.js'; 
import Footer from './Footer.js';
import './App.css';

import Background from './mountainsPurple.jpg'

import ScrollableAnchor from 'react-scrollable-anchor'

var sectionStyle = {
  backgroundImage: `url(${Background})`
};


function App() {
  return (
    <BrowserRouter>
      <div className="App" style={ sectionStyle }>

        <nav className="navbar header">
          <ul className="nav">
            <li className="nav-item">
              <a href='#projects' className="item"> Projects </a>
            </li>
            <li className="nav-item">
              <a href='#articles' className="item"> Articles </a>
            </li>
            <li className="nav-item">
              <a href='#about' className="item"> About Me </a>
            </li>
          </ul>
        </nav>

        <ScrollableAnchor id={'projects'}>
          <div> Hello World </div>


        </ScrollableAnchor>
        <ScrollableAnchor id={'articles'}>
          <div> How are you world? </div>
          <Articles></Articles>
        </ScrollableAnchor>

        <ScrollableAnchor id={'about'}>
          <div> How are you dumb ass? </div>
          <About></About>
        </ScrollableAnchor>

        <Footer style={ sectionStyle }></Footer>
      </div>
    </BrowserRouter>
  );
}

export default App;



